webpackJsonp([0xfcec33aa1023],{7985:function(e,t){e.exports={data:{post:{html:'<p>Nico is hosting a <a href="http://lumma.de/eintrag.php?id=3658">Gl&uuml;hwein get-together</a> at the Rathausmarkt in Hamburg tomorrow evening (Tuesday, 4 Dec) at 6:30 pm. By hosting I mean Nico has set the time and place, not that he\'s buying the first round. But I could be wrong. :-)</p>\n<p>I\'ll try to be there at least for the beginning. How long I stay depends on whether Christopher comes with me or not.</p>\n<p>We\'ll be at the Friesensch&auml;nke stand, which is directly on the left when one faces the Rathaus from the bus stop. I\'ll be standing next to the guy holding a mug of Gl&uuml;hwein.</p>\n<p><a href="http://www.flickr.com/photos/lumma/2077450883/" title="photo sharing"><img src="https://farm3.static.flickr.com/2289/2077450883_190124b7f0_m.jpg" alt="" style="border: 0px;" /></a></p>',fields:{title:"Open Glühwein Club",date:"03 Dec 2007",url:"https://papascott.de/2007-12-03-open-gluehwein-club/"}}},pathContext:{slug:"/2007-12-03-open-gluehwein-club/",prev:{fields:{title:"Second Day with McCafé",date:"02 Dec 2007",slug:"/2007-12-02-second-day-with-mccaf/"}},next:{fields:{title:"No DSL",date:"06 Dec 2007",slug:"/2007-12-06-no-dsl/"}}}}}});
